import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { Card } from "../components/ui/card";
import { Button } from "../components/ui/button";
import { Alert, AlertDescription, AlertTitle } from "../components/ui/alert";
import { InfoIcon } from "lucide-react";
import { useToast } from "../hooks/useToast";
import { DEFAULT_CONFIG, PHYSICS_OPTIONS, DYNAMICS_OPTIONS, PROJECTIONS, DATA_SOURCES } from "../utils/constants";

const Review = () => {
  const navigate = useNavigate();
  const { toast } = useToast();
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [config, setConfig] = useState(null);

  useEffect(() => {
    const loadConfig = () => {
      setLoading(true);
      try {
        const savedConfig = localStorage.getItem("wrf_config");
        if (savedConfig) {
          const parsedConfig = JSON.parse(savedConfig);
          setConfig(parsedConfig);
          setError(null);
        } else {
          setConfig(DEFAULT_CONFIG);
          setError("未找到保存的配置，请完成所有设置步骤");
          toast({
            title: "配置未找到",
            description: "未找到保存的配置，请返回完成所有设置步骤",
            variant: "destructive",
          });
        }
      } catch (err) {
        console.error("Error parsing saved configuration:", err);
        setConfig(DEFAULT_CONFIG);
        setError("配置加载失败，请检查是否已完成所有设置步骤");
        toast({
          title: "配置加载错误",
          description: "无法加载保存的配置，请返回重新配置",
          variant: "destructive",
        });
      } finally {
        setLoading(false);
      }
    };

    loadConfig();
  }, [toast]);

  const handleGenerate = () => {
    // 将配置转换为namelist格式的代码将在此实现
    toast({
      title: "生成配置文件",
      description: "成功生成namelist.input文件",
    });
    // 可以添加下载配置文件的逻辑
  };

  const handlePreviousStep = () => {
    navigate("/dynamics");
  };

  if (loading) {
    return (
      <div className="container mx-auto max-w-7xl p-6">
        <div className="flex justify-center items-center h-[60vh]">
          <p className="text-lg text-muted-foreground">正在加载配置信息...</p>
        </div>
      </div>
    );
  }

  // 检查配置是否完整
  const isTimeConfigComplete = config?.start_date && config?.end_date;
  const isDomainConfigComplete = config?.domain && config.domain.e_we && config.domain.e_sn;
  const isPhysicsConfigComplete = config?.physics && config.physics.mp_physics !== undefined;
  const isDynamicsConfigComplete = config?.dynamics && config.dynamics.diff_opt !== undefined;

  const isConfigComplete = 
    isTimeConfigComplete && 
    isDomainConfigComplete && 
    isPhysicsConfigComplete && 
    isDynamicsConfigComplete;

  return (
    <div className="container mx-auto max-w-7xl p-6">
      <h1 className="text-3xl font-bold mb-2">配置审核</h1>
      <p className="text-muted-foreground mb-6">
        审核所有的WRF配置选项并生成namelist文件
      </p>

      {error && (
        <Alert variant="destructive" className="mb-6">
          <InfoIcon className="h-4 w-4" />
          <AlertTitle>配置错误</AlertTitle>
          <AlertDescription>{error}</AlertDescription>
        </Alert>
      )}

      {!isConfigComplete && !error && (
        <Alert className="mb-6 bg-amber-50 border-amber-200">
          <InfoIcon className="h-4 w-4 text-amber-600" />
          <AlertTitle className="text-amber-800">配置不完整</AlertTitle>
          <AlertDescription className="text-amber-700">
            请完成所有配置步骤以确保生成准确的namelist文件。
            {!isTimeConfigComplete && <div className="mt-1">• 时间设置尚未完成</div>}
            {!isDomainConfigComplete && <div className="mt-1">• 域设置尚未完成</div>}
            {!isPhysicsConfigComplete && <div className="mt-1">• 物理参数化设置尚未完成</div>}
            {!isDynamicsConfigComplete && <div className="mt-1">• 动力学设置尚未完成</div>}
          </AlertDescription>
        </Alert>
      )}

      <div className="grid grid-cols-1 gap-6 mb-6">
        <Card className="w-full p-6">
          <h2 className="text-2xl font-bold mb-4">时间设置</h2>
          {isTimeConfigComplete ? (
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div>
                <p className="text-sm font-medium text-muted-foreground">开始时间</p>
                <p>{config.start_date}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">结束时间</p>
                <p>{config.end_date}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">数据源</p>
                <p>{config.data_source ? DATA_SOURCES[config.data_source] : "未设置"}</p>
              </div>
            </div>
          ) : (
            <div className="p-4 rounded-md bg-slate-50">
              <p className="text-muted-foreground">未完成时间设置</p>
              <Button 
                variant="outline" 
                size="sm" 
                onClick={() => navigate("/time")} 
                className="mt-2"
              >
                前往设置
              </Button>
            </div>
          )}
        </Card>

        <Card className="w-full p-6">
          <h2 className="text-2xl font-bold mb-4">域设置</h2>
          {isDomainConfigComplete ? (
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div>
                <p className="text-sm font-medium text-muted-foreground">投影方式</p>
                <p>{config.domain.map_proj ? PROJECTIONS[config.projection] : "Lambert Conformal"}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">域数量</p>
                <p>{config.domain.max_dom}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">网格点数 (E-W)</p>
                <p>{config.domain.e_we}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">网格点数 (N-S)</p>
                <p>{config.domain.e_sn}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">网格间距 DX (km)</p>
                <p>{config.domain.dx}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">网格间距 DY (km)</p>
                <p>{config.domain.dy}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">中心纬度</p>
                <p>{config.domain.ref_lat}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">中心经度</p>
                <p>{config.domain.ref_lon}</p>
              </div>
            </div>
          ) : (
            <div className="p-4 rounded-md bg-slate-50">
              <p className="text-muted-foreground">未完成域设置</p>
              <Button 
                variant="outline" 
                size="sm" 
                onClick={() => navigate("/domain")} 
                className="mt-2"
              >
                前往设置
              </Button>
            </div>
          )}
        </Card>

        <Card className="w-full p-6">
          <h2 className="text-2xl font-bold mb-4">物理参数化方案</h2>
          {isPhysicsConfigComplete ? (
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div>
                <p className="text-sm font-medium text-muted-foreground">微物理方案</p>
                <p>{PHYSICS_OPTIONS.mp_physics[config.physics.mp_physics]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">积云方案</p>
                <p>{PHYSICS_OPTIONS.cu_physics[config.physics.cu_physics]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">长波辐射方案</p>
                <p>{PHYSICS_OPTIONS.ra_lw_physics[config.physics.ra_lw_physics]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">短波辐射方案</p>
                <p>{PHYSICS_OPTIONS.ra_sw_physics[config.physics.ra_sw_physics]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">地表层方案</p>
                <p>{PHYSICS_OPTIONS.sf_surface_physics[config.physics.sf_surface_physics]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">边界层方案</p>
                <p>{PHYSICS_OPTIONS.bl_pbl_physics[config.physics.bl_pbl_physics]}</p>
              </div>
            </div>
          ) : (
            <div className="p-4 rounded-md bg-slate-50">
              <p className="text-muted-foreground">未完成物理参数设置</p>
              <Button 
                variant="outline" 
                size="sm" 
                onClick={() => navigate("/physics")} 
                className="mt-2"
              >
                前往设置
              </Button>
            </div>
          )}
        </Card>

        <Card className="w-full p-6">
          <h2 className="text-2xl font-bold mb-4">动力学设置</h2>
          {isDynamicsConfigComplete ? (
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div>
                <p className="text-sm font-medium text-muted-foreground">扩散选项</p>
                <p>{DYNAMICS_OPTIONS.diff_opt[config.dynamics.diff_opt]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">湍流系数选项</p>
                <p>{DYNAMICS_OPTIONS.km_opt[config.dynamics.km_opt]}</p>
              </div>
              <div>
                <p className="text-sm font-medium text-muted-foreground">非静力学模式</p>
                <p>{config.dynamics.non_hydrostatic ? "开启" : "关闭"}</p>
              </div>
            </div>
          ) : (
            <div className="p-4 rounded-md bg-slate-50">
              <p className="text-muted-foreground">未完成动力学设置</p>
              <Button 
                variant="outline" 
                size="sm" 
                onClick={() => navigate("/dynamics")} 
                className="mt-2"
              >
                前往设置
              </Button>
            </div>
          )}
        </Card>
      </div>

      <div className="flex justify-between">
        <Button 
          variant="outline" 
          onClick={handlePreviousStep}
        >
          返回动力学设置
        </Button>

        <Button 
          onClick={handleGenerate}
          disabled={!isConfigComplete}
        >
          生成Namelist文件
        </Button>
      </div>
    </div>
  );
};

export default Review;
